from collections import defaultdict
class Solution(object):
	def possibleBipartition(self, N, dislikes):

		dis = defaultdict(set)
		for di in dislikes:
			dis[di[0]].add(di[1])
			dis[di[1]].add(di[0])

		g_applicable = [{_ for _ in xrange(N)}, {_ for _ in xrange(N)}]
		g = [[], []]

		def find_p(n, g):
			if n > N:
				return True

			for i in xrange(2):
				if n in g_applicable[i]:
					rm = []
					for p in dis[n]:
						if p in g_applicable[i]:
							g_applicable[i].remove(p)
							rm.append(p)

					if find_p(n + 1, g):
						return True

					for p in rm:
						g_applicable[i].add(p)
			return False

		return find_p(1, g)


